import React from 'react';

export class TodoList extends React.Component {
    render() {
        const items = this.props.myTask.map((elem, i) => {
            return (
                <li>
                    {i + 1} {elem}
                </li>
            )
        });
        return (
            <div className="todo-list">
                <ul>
                    {items}
                </ul>
            </div>
        )
    }
}
